import React from 'react';
import Header from './Header/Header.js';
import Main from './Main/Main.js';
import Footer from './Footer/Footer.js';
import PopupWithForm from './PopupWithForm/PopupWithForm.js';
import PopupWithImage from './PopupWithImage/PopupWithImage.js';
import api from '../utils/api.js';

function App() {

    const [isEditProfilePopupOpen, setIsEditProfilePopupOpen] = React.useState(false);
    const [isAddPlacePopupOpen, setIsAddPlacePopupOpen] = React.useState(false);
    const [isEditAvatarPopupOpen, setIsEditAvatarPopupOpen] = React.useState(false);
    const [cards, setCards] = React.useState([]);

    const handleEditProfileClick = () => {
        setIsEditProfilePopupOpen(true);
    }

    const handleEditAvatarClick = () => {
        setIsEditAvatarPopupOpen(true);
    }

    const handleAddPlaceClick = () => {
        setIsAddPlacePopupOpen(true);
    }

    const closeAllPopups = () => {
        setIsEditProfilePopupOpen(false);
        setIsAddPlacePopupOpen(false);
        setIsEditAvatarPopupOpen(false);
    }

    React.useEffect(() => {
        api.getCards().then(data => {
            setCards(data.map(card => {
                console.log(card.owner)
                return {
                    name: card.name,
                    link: card.link,
                    id: card._id,
                    ownerId: card.owner._id,
                    like: card.likes
                }
            }));
        }).catch(err => console.log(err));
    }, [])


  return (
    <div className="page">
        <Header />

        <Main 
            onEditProfile={handleEditProfileClick} 
            onAddPlace={handleAddPlaceClick}
            onEditAvatar={handleEditAvatarClick}/>

        <Footer />

        <PopupWithForm name='form-profile' title='Редактировать профиль' textButton='Сохранить' isOpen={isEditProfilePopupOpen} onClose={closeAllPopups}>
                        <label htmlFor="popup__input-name">
                            <input className="popup__input popup__input_type_name" id="popup__input-name" minLength="2" maxLength="40" name="name" type="text" placeholder="Имя" value="Жак-Ив Кусто" required />
                            <span className="popup__input-error popup__input-name-error"></span>
                        </label>
                        <label htmlFor="popup__input-profession">
                            <input className="popup__input popup__input_type_profession" id="popup__input-profession" minLength="2" maxLength="200" name="about" type="text" placeholder="Вид деятельности" value="Исследователь океана" required />
                            <span className="popup__input-error popup__input-profession-error"></span>
                        </label>
        </PopupWithForm>

        <PopupWithForm name='form-add-photo' title='Новое место' textButton='Создать' isOpen={isAddPlacePopupOpen} onClose={closeAllPopups}>
                        <label htmlFor="popup__input-title-pictire">
                            <input className="popup__input popup__input_type_title" id="popup__input-title-pictire" minLength="2" maxLength="30" name="title" type="text" placeholder="Название" value="" required />
                            <span className="popup__input-error popup__input-title-pictire-error"></span>
                        </label>
                        <label htmlFor="popup__input-link">
                            <input className="popup__input popup__input_type_link" id="popup__input-link" name="link" type="url" placeholder="Ссылка на картинку" value="" required />
                            <span className="popup__input-error popup__input-link-error"></span>
                        </label>
        </PopupWithForm>

        <PopupWithForm name='form-avatar' title='Обновить аватар' textButton='Сохранить' isOpen={isEditAvatarPopupOpen} onClose={closeAllPopups}>
                        <label htmlFor="popup__input-avatar-pictire">
                            <input className="popup__input popup__input_type_avatar" id="popup__input-avatar-pictire" minLength="2" name="avatar" type="text" placeholder="Введите ссылку" value="" required />
                            <span className="popup__input-error popup__input-avatar-pictire-error"></span>
                        </label>
        </PopupWithForm>

        <PopupWithForm name='form-confirm' title='Вы уверены?' textButton='Да'></PopupWithForm>

        <PopupWithImage />

        <template className="template-add-cards">
            <article className="element">
                <img className="element__image" src="#" alt="#" />
                <div className="element__place">
                    <h2 className="element__title"></h2>
                    <div className="element__like-box">
                        <button className="element__button-like" type="button"></button>
                        <p className="element__like-length">0</p>
                    </div>
                </div>
                <button className="element__button-trash " type="button"></button>
            </article>
        </template>

    </div>
  );
}

export default App;
